import React from 'react';
import {
    Navbar,
    NavbarBrand,Dropdown, DropdownToggle, DropdownMenu, DropdownItem
} from 'reactstrap';
class CustomNavbar extends React.Component{
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            isOpen: false,
            dropdownOpen: false
        };
        this.toggleDropdown  =this.toggleDropdown.bind(this);
    }
    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }
    toggleDropdown(){
        this.setState(prevState => ({
            dropdownOpen: !prevState.dropdownOpen
        }));
    }
    render(){
     return(
         <div>
             <Navbar  light expand="md" className="navbar-background">
                 <NavbarBrand href="/"><i className="fas fa-home fa-2x "/></NavbarBrand>
                 <form className=" w-50 mx-auto">
                 <div className="input-group">
                     <Dropdown isOpen={this.state.dropdownOpen} toggle={this.toggleDropdown}>
                         <DropdownToggle caret className="rounded-left form-group-prepend btn btn-secondary">
                             Dropdown
                         </DropdownToggle>
                         <DropdownMenu>
                             <DropdownItem>Book Name</DropdownItem>
                             <DropdownItem>Book ISBN</DropdownItem>
                         </DropdownMenu>
                     </Dropdown>
                     <input type="text" className="form-control" placeholder="Book name"
                            aria-label="Recipient's username" aria-describedby="basic-addon2"/>
                         <div className="input-group-append">
                             <span className="input-group-text" id="basic-addon2">SEARCH</span>
                         </div>
                 </div>
                 </form>
           {/*      <form className="form-inline w-50 mx-auto">
                     <input className=" col-10 rounded-left" type="search" placeholder="Search" aria-label="Search"/>
                     <button className="btn btn-outline-success col-2 rounded-left" type="submit">Search</button>
                 </form>*/}
             </Navbar>

         </div>
     );
    }
}
export default CustomNavbar;
